import React, {useState} from "react";
import { NavLink, useNavigate } from "react-router-dom";

const AddInventory = () => {
  return (
    <>
          <div className="d-flex justify-content-center align-items-center mt-5">
            <div className="col-4">
                <div className="card h-100 justify-content-center">
                  <h5 className="card-header">Create new Inventory Store</h5>
                  <div className="card-body d-flex flex-column">
                    <form method="POST">
                      <div className="form-group mb-2">
                          <label htmlFor="store">Store Name<span className="required-field">*</span></label>
                          <input type="text" id="store"  className="form-control" placeholder="Enter Store Name" name="store" required/>
                      </div>      
                        
                    </form>
                    <button type="submit" name="add" id="add"  className="mt-3 btn btn-sm w-100 btn-outline-dark">Add Store</button>
                  </div>
                  <div className="card-footer text-muted">
                  Don't have an account? <NavLink to="/register">Register Now</NavLink>
                      </div>
                </div>
            </div>
        </div>
    </>
  );
};

export default AddInventory;
